import React from "react";
import { ImageBackground, StyleSheet, View, Button, Text } from "react-native";

const Card = ({ name, status, imageUrl }) => (
  <View>
    <Text>Hi, I am testing!</Text>
  </View>
);

const styles = StyleSheet.create({});

export default Card;
